package day0918;

public class Reload {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
	}
	public void eat(){
		System.out.println("yo~~");
	}
	public void eat(String food){
		System.out.println(food+"真好吃");
	}
	/*虽然上诉两个方法的返回值类型相同，方法名相同，但是它们的参数列表不一样。因此可作为两种方法。
	 该方式名为方法重载。*/
}
